from __future__ import division
from gurobipy import *
import copy


def sorsolver_loop(nodeNum, pathSet, TM, cMatrix, regionNum, pathNumListReduced, pathNumMapRegion, nodeRegionId, regionrMatrix):
    static_pathw = init_pathw(nodeNum, regionNum, nodeRegionId, pathSet)
    # print(static_pathw)
    # exit()
    TM_tmp = copy.deepcopy(TM)
    candidateMaxUtil = []
    for test in range(10):
        pathw, _ = sorsolver_newb(nodeNum, pathSet, TM_tmp, cMatrix, regionNum, pathNumListReduced, pathNumMapRegion, nodeRegionId, regionrMatrix, static_pathw)
        # pathw = parse_pathw(nodeNum, regionNum, pathw, nodeRegionId, pathSet)
        # compute current val (under original TM)
        actionmatrix = []
        for src in range(nodeNum):
            actionmatrix.append([])
            for dst in range(nodeNum):
                actionmatrix[src].append([])
        if True: # MMA
            # print("hkshgjkahg")
            actionRangeMap = []
            for src in range(nodeNum):
                actionRangeMap.append([])
                for rid in range(regionNum):
                    actionRangeMap[src].append([])
            actCountList = [0]*regionNum
            for src in range(nodeNum):
                sRegion = nodeRegionId[src]
                for tRegion in range(regionNum):
                    if sRegion == tRegion:
                        continue
                    if regionrMatrix[sRegion][tRegion] != tRegion:  # region-level
                        continue
                    actionRangeMap[src][tRegion] = [actCountList[sRegion], actCountList[sRegion]+pathNumMapRegion[src][tRegion]]
                    actCountList[sRegion] += pathNumMapRegion[src][tRegion]
            
            for src in range(nodeNum):
                sRegion = nodeRegionId[src]
                for tRegion in range(regionNum):
                    if sRegion == tRegion:
                        continue
                    if regionrMatrix[sRegion][tRegion] != tRegion:
                        nextRegionHop = regionrMatrix[sRegion][tRegion]
                        actionRangeMap[src][tRegion] = actionRangeMap[src][nextRegionHop]
            
            actCountList = [0]*regionNum
            for src in range(nodeNum):
                for dst in range(nodeNum):
                    if src == dst:
                        continue
                    sRegion = nodeRegionId[src]
                    tRegion = nodeRegionId[dst]
                    pathNum = len(pathSet[src][dst])
                    if sRegion == tRegion:
                        action = pathw[sRegion][0][actCountList[sRegion]:actCountList[sRegion]+pathNum]
                        actionmatrix[src][dst] = action
                        actCountList[sRegion] += pathNum
                    else:
                        actionRange = actionRangeMap[src][tRegion]
                        action = pathw[sRegion][1][actionRange[0]:actionRange[1]]
                        actionmatrix[src][dst] = action
        flowmap = []
        for _ in range(nodeNum):
            flowmap.append([0.0]*nodeNum)
        
        TM_tmp = copy.deepcopy(TM)
        for src in range(nodeNum):
            for dst in range(nodeNum):
                if src == dst:
                    continue
                
                sources = [src]
                sizes = [TM[src][dst]]
                while True:
                    if len(sources) == 0:
                        break
                    # update TM_tmp
                    if sources[0] != src:
                        TM_tmp[sources[0]][dst] += sizes[0]
                    # end

                    pathset = pathSet[sources[0]][dst]
                    action = actionmatrix[sources[0]][dst]

                    # subsizes, gates = com_path_flow(flowmap, pathset, action, sizes[0])
                    subsizes = []
                    gates = []
                    size = sizes[0]
                    pathnum = len(pathset)
                    tmp = 0
                    s = pathset[0][0]
                    t = pathset[0][-1]
                    gates.append(t)
                    for i in range(pathnum):
                        length = len(pathset[i])
                        subsize = action[i]*size
                        if t != pathset[i][-1]:
                            t = pathset[i][-1]
                            gates.append(t)
                            subsizes.append(tmp)
                            tmp = 0
                        tmp += subsize
                        for j in range(length-1):
                            node1 = pathset[i][j]
                            node2 = pathset[i][j+1]
                            flowmap[node1][node2] += subsize
                    subsizes.append(tmp)

                    # break
                    sources.pop(0)
                    sizes.pop(0)
                    for gwid in range(len(gates)):
                        if gates[gwid] == dst:
                            continue
                        sources.append(gates[gwid])
                        sizes.append(subsizes[gwid])

        # compute util
        edgeutils = []
        mu = 0
        muid = (0, 0)
        for i in range(nodeNum):
            for j in range(nodeNum):
                if cMatrix[i][j] > 0:
                    util = flowmap[i][j] / cMatrix[i][j]
                    edgeutils.append(util)
                    if util > mu:
                        mu = util
                        muid = (i,j)
        maxutil = max(edgeutils)
        # print("Test:", test, " ", maxutil, muid)
        candidateMaxUtil.append(maxutil)
        
    # print(pathw)
    # print(pathw[0])
    pathw = parse_pathw(nodeNum, regionNum, pathw, nodeRegionId, pathSet)
    # print(pathw[0])
    actions = []
    for item in pathw:
        actions += item
    # print(actions)
    return [], min(candidateMaxUtil)


def sorsolver_newb(nodeNum, pathSet, TM, cMatrix, regionNum, pathNumListReduced, pathNumMapRegion, nodeRegionId, regionrMatrix, static_pathw = []):
    model = Model('netflow')
    model.setParam("OutputFlag", 0)
    #####print("generate path variable constraints")

    pathNums = []
    for rid in range(regionNum):
        pathNums.append([sum(pathNumListReduced[rid][0]), sum(pathNumListReduced[rid][1])])
    # pathVarNum = sum([sum(item) for item in pathNums])
    # print(pathNums)
    fpath = []
    for rid in range(regionNum):
        fpath.append([])
        for i in range(2):
            fpath[rid].append([])
            for _ in range(pathNums[rid][i]):
                fpath[rid][i].append(model.addVar(0, GRB.INFINITY, 0, GRB.CONTINUOUS, "path"))
    phi = model.addVar(0, GRB.INFINITY, 0, GRB.CONTINUOUS, "phi")

    # incre test
    if static_pathw != []:
        for sta in static_pathw:
            model.addConstr(fpath[sta[0]][0][sta[1]] == sta[2])

    ###print("add capacaity and objective constraints")
    for rid in range(regionNum):
        for i in range(2):
            pathVarID = 0
            pathNumList = pathNumListReduced[rid][i]
            for pathNum in pathNumList:
                sumw = 0
                for _ in range(pathNum):
                    sumw += fpath[rid][i][pathVarID]
                    pathVarID += 1
                model.addConstr(sumw == 1)

    actionmatrix = []
    for src in range(nodeNum):
        actionmatrix.append([])
        for dst in range(nodeNum):
            actionmatrix[src].append([])
    if True: # MMA
        # print("hkshgjkahg")
        actionRangeMap = []
        for src in range(nodeNum):
            actionRangeMap.append([])
            for rid in range(regionNum):
                actionRangeMap[src].append([])
        actCountList = [0]*regionNum
        for src in range(nodeNum):
            sRegion = nodeRegionId[src]
            for tRegion in range(regionNum):
                if sRegion == tRegion:
                    continue
                if regionrMatrix[sRegion][tRegion] != tRegion:  # region-level
                    continue
                actionRangeMap[src][tRegion] = [actCountList[sRegion], actCountList[sRegion]+pathNumMapRegion[src][tRegion]]
                actCountList[sRegion] += pathNumMapRegion[src][tRegion]
        
        for src in range(nodeNum):
            sRegion = nodeRegionId[src]
            for tRegion in range(regionNum):
                if sRegion == tRegion:
                    continue
                if regionrMatrix[sRegion][tRegion] != tRegion:
                    nextRegionHop = regionrMatrix[sRegion][tRegion]
                    actionRangeMap[src][tRegion] = actionRangeMap[src][nextRegionHop]
        
        actCountList = [0]*regionNum
        for src in range(nodeNum):
            for dst in range(nodeNum):
                if src == dst:
                    continue
                sRegion = nodeRegionId[src]
                tRegion = nodeRegionId[dst]
                pathNum = len(pathSet[src][dst])
                if sRegion == tRegion:
                    action = fpath[sRegion][0][actCountList[sRegion]:actCountList[sRegion]+pathNum]
                    actionmatrix[src][dst] = action
                    actCountList[sRegion] += pathNum
                else:
                    actionRange = actionRangeMap[src][tRegion]
                    action = fpath[sRegion][1][actionRange[0]:actionRange[1]]
                    actionmatrix[src][dst] = action

    # compute flowmap
    flowmap = []
    for _ in range(nodeNum):
        flowmap.append([0.0]*nodeNum)
    for src in range(nodeNum):
        for dst in range(nodeNum):
            if src == dst:
                continue
            
            sources = [src]
            sizes = [TM[src][dst]]
            while True:
                if len(sources) == 0:
                    break
                pathset = pathSet[sources[0]][dst]
                action = actionmatrix[sources[0]][dst]

                # subsizes, gates = com_path_flow(flowmap, pathset, action, sizes[0])
                subsizes = []
                gates = []
                size = sizes[0]
                pathnum = len(pathset)
                tmp = 0
                s = pathset[0][0]
                t = pathset[0][-1]
                gates.append(t)
                for i in range(pathnum):
                    length = len(pathset[i])
                    subsize = action[i]*size
                    if t != pathset[i][-1]:
                        t = pathset[i][-1]
                        gates.append(t)
                        subsizes.append(tmp)
                        tmp = 0
                    tmp += subsize
                    for j in range(length-1):
                        node1 = pathset[i][j]
                        node2 = pathset[i][j+1]
                        flowmap[node1][node2] += subsize
                subsizes.append(tmp)

                break
                sources.pop(0)
                sizes.pop(0)
                for gwid in range(len(gates)):
                    if gates[gwid] == dst:
                        continue
                    sources.append(gates[gwid])
                    sizes.append(subsizes[gwid])

    # compute util
    for i in range(nodeNum):
        for j in range(nodeNum):
            if cMatrix[i][j] > 0:
                edgeload = flowmap[i][j]
                model.addConstr(edgeload <= phi*cMatrix[i][j])

    ###print("set objective and solve the problem")
    model.setObjective(phi, GRB.MINIMIZE)
    model.optimize()
    pathw = []
    if model.status == GRB.Status.OPTIMAL:
        for rid in range(regionNum):
            pathw.append([])
            for i in range(2):
                pathw[rid].append([])
                for j in range(pathNums[rid][i]):
                    pathw[rid][i].append(fpath[rid][i][j].getAttr(GRB.Attr.X))
        actionmatrix = []
        for src in range(nodeNum):
            actionmatrix.append([])
            for dst in range(nodeNum):
                actionmatrix[src].append([])
        if True: # MMA
            # print("hkshgjkahg")
            actionRangeMap = []
            for src in range(nodeNum):
                actionRangeMap.append([])
                for rid in range(regionNum):
                    actionRangeMap[src].append([])
            actCountList = [0]*regionNum
            for src in range(nodeNum):
                sRegion = nodeRegionId[src]
                for tRegion in range(regionNum):
                    if sRegion == tRegion:
                        continue
                    if regionrMatrix[sRegion][tRegion] != tRegion:  # region-level
                        continue
                    actionRangeMap[src][tRegion] = [actCountList[sRegion], actCountList[sRegion]+pathNumMapRegion[src][tRegion]]
                    actCountList[sRegion] += pathNumMapRegion[src][tRegion]
                
            for src in range(nodeNum):
                sRegion = nodeRegionId[src]
                for tRegion in range(regionNum):
                    if sRegion == tRegion:
                        continue
                    if regionrMatrix[sRegion][tRegion] != tRegion:
                        nextRegionHop = regionrMatrix[sRegion][tRegion]
                        actionRangeMap[src][tRegion] = actionRangeMap[src][nextRegionHop]
            
            actCountList = [0]*regionNum
            for src in range(nodeNum):
                for dst in range(nodeNum):
                    if src == dst:
                        continue
                    sRegion = nodeRegionId[src]
                    tRegion = nodeRegionId[dst]
                    pathNum = len(pathSet[src][dst])
                    if sRegion == tRegion:
                        action = pathw[sRegion][0][actCountList[sRegion]:actCountList[sRegion]+pathNum]
                        actionmatrix[src][dst] = action
                        actCountList[sRegion] += pathNum
                    else:
                        actionRange = actionRangeMap[src][tRegion]
                        action = pathw[sRegion][1][actionRange[0]:actionRange[1]]
                        actionmatrix[src][dst] = action
        flowmap = []
        for _ in range(nodeNum):
            flowmap.append([0.0]*nodeNum)
        for src in range(nodeNum):
            for dst in range(nodeNum):
                if src == dst:
                    continue
                
                sources = [src]
                sizes = [TM[src][dst]]
                while True:
                    if len(sources) == 0:
                        break
                    pathset = pathSet[sources[0]][dst]
                    action = actionmatrix[sources[0]][dst]

                    # subsizes, gates = com_path_flow(flowmap, pathset, action, sizes[0])
                    subsizes = []
                    gates = []
                    size = sizes[0]
                    pathnum = len(pathset)
                    tmp = 0
                    s = pathset[0][0]
                    t = pathset[0][-1]
                    gates.append(t)
                    for i in range(pathnum):
                        length = len(pathset[i])
                        subsize = action[i]*size
                        if t != pathset[i][-1]:
                            t = pathset[i][-1]
                            gates.append(t)
                            subsizes.append(tmp)
                            tmp = 0
                        tmp += subsize
                        for j in range(length-1):
                            node1 = pathset[i][j]
                            node2 = pathset[i][j+1]
                            flowmap[node1][node2] += subsize
                    subsizes.append(tmp)

                    # break
                    sources.pop(0)
                    sizes.pop(0)
                    for gwid in range(len(gates)):
                        if gates[gwid] == dst:
                            continue
                        sources.append(gates[gwid])
                        sizes.append(subsizes[gwid])

        # compute util
        edgeutils = []
        for i in range(nodeNum):
            for j in range(nodeNum):
                if cMatrix[i][j] > 0:
                    util = flowmap[i][j] / cMatrix[i][j]
                    edgeutils.append(util)
        # print(model.objVal, max(edgeutils))
    else:
        print("\n!!!!!!!!!!! No solution !!!!!!!!!!!!!!\n")
                
    return pathw, model.objVal


