def init_pathw(nodeNum, regionNum, nodeRegionId, pathSet):
    res = []
    smalldemidmap = get_data()
    actCountList = [0]*regionNum
    demId = 0
    for src in range(nodeNum):
        for dst in range(nodeNum):
            if src == dst:
                continue
            sRegion = nodeRegionId[src]
            tRegion = nodeRegionId[dst]
            pathNum = len(pathSet[src][dst])
            if sRegion == tRegion:
                if smalldemidmap[demId] == 1:
                    for _ in range(pathNum-1):
                        res.append([sRegion, actCountList[sRegion], 1.0/pathNum])
                        actCountList[sRegion] += 1
                    actCountList[sRegion] += 1
                    
                    # res.append([sRegion, actCountList[sRegion], 1.0])
                    # actCountList[sRegion] += pathNum
                else:
                    actCountList[sRegion] += pathNum
            demId += 1
    return res



def parse_pathw(nodeNum, regionNum, pathw, nodeRegionId, pathSet):
    res = []
    for rid in range(regionNum):
        res.append([[], pathw[rid][1]])
    smalldemidmap = get_data()
    actCountList = [0]*regionNum
    demId = 0
    for src in range(nodeNum):
        for dst in range(nodeNum):
            if src == dst:
                continue
            sRegion = nodeRegionId[src]
            tRegion = nodeRegionId[dst]
            pathNum = len(pathSet[src][dst])
            if sRegion == tRegion:
                action = pathw[sRegion][0][actCountList[sRegion]:actCountList[sRegion]+pathNum]
                actCountList[sRegion] += pathNum
                if smalldemidmap[demId] == 0:
                    res[sRegion][0] += action
            demId += 1
    return res

